import React from 'react';
import Countdown from 'react-countdown';
import './Timer.css';

class Timer extends React.Component {
  complete() {
    console.log('Done!');
  }

  render() {
    return (
      <Countdown className='timer' date={Date.now() + 5000}>
        <audio src='http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/pause.wav'></audio>
        {/* {new Audio('http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/pause.wav').play()} */}
      </Countdown>
    );
  }
}

export default Timer;
